import machinefrom mfrc522 import MFRC522import utimeprint("main")ledS = machine.Pin(22, machine.Pin.OUT)ledP = machine.Pin(16, machine.Pin.OUT)ledZ = machine.Pin(17, machine.Pin.OUT)ledP.value(0)ledZ.value(0)ledS.value(0)s = socket.socket(socket.AF_INET, socket.SOCK_STREAM)s.bind(('', 80))s.listen(5)reader = MFRC522(spi_id=0, sck=18, miso=19, mosi=23, cs=5, rst=21)def read():    reader.init()    stat, tag_type = reader.request(reader.REQIDL)    if stat == reader.OK:        (stat, uid) = reader.SelectTagSN()        if stat == reader.OK:            card = int.from_bytes(bytes(uid),"little",False)            print("CARD ID: "+str(card))            ledS.value(1)while True:  read()  utime.sleep_ms(100)  ledS.value(0)